import  React from 'react';
import { connect } from 'react-redux';

const ImageSelection = ({url}) => {
  console.log(url)
  return(
    <div>
      images
    </div>
  );
};

const mapStateToProps = state => {
  return {
    url: state.url.exampleImages
  };
};

export default connect(mapStateToProps)(ImageSelection);
